import { Router, ActivatedRouteSnapshot, RouterStateSnapshot } from '@angular/router';
import * as faceapi from 'face-api.js';

export const PanelGuard: (route: ActivatedRouteSnapshot, state: RouterStateSnapshot, router: Router) => Promise<boolean> = canActivatePanel;

async function loadModels(): Promise<void> {
  await faceapi.nets.tinyFaceDetector.loadFromUri('../../assets/models');
  await faceapi.nets.faceLandmark68Net.loadFromUri('../../assets/models');
  await faceapi.nets.faceRecognitionNet.loadFromUri('../../assets/models');
  await faceapi.nets.faceLandmark68TinyNet.loadFromUri('../../assets/models');
  await faceapi.nets.faceExpressionNet.loadFromUri('../../assets/models');
  await faceapi.nets.ageGenderNet.loadFromUri('../../assets/models');
  await faceapi.nets.ssdMobilenetv1.loadFromUri('../../assets/models');
}

async function initializeWebcam(): Promise<HTMLVideoElement> {
  const videoElement = document.createElement('video');
  videoElement.style.cssText = 'height: 100vh; width: 100%; object-fit: fill; position: absolute; top: 0;';
  document.body.append(videoElement);

  const stream = await navigator.mediaDevices.getUserMedia({ video: true });
  videoElement.srcObject = stream;
  await videoElement.play();

  return videoElement;
}

async function processBase64Images(base64Images: { base64: string; label: string }[]): Promise<faceapi.FaceMatcher> {
  const labeledFaceDescriptors: faceapi.LabeledFaceDescriptors[] = [];

  for (const { base64, label } of base64Images) {
    const base64Response = await fetch(base64);
    const blob = await base64Response.blob();
    const image = await faceapi.bufferToImage(blob);
    const detections = await faceapi.detectSingleFace(image)
      .withFaceLandmarks()
        .withFaceExpressions()
        .withAgeAndGender()
      .withFaceDescriptor();

    if (detections) {
      labeledFaceDescriptors.push(new faceapi.LabeledFaceDescriptors(label, [detections.descriptor]));
    }
  }

  return new faceapi.FaceMatcher(labeledFaceDescriptors, 0.6);
}

async function waitForDetection(videoElement: HTMLVideoElement, faceMatcher: faceapi.FaceMatcher): Promise<boolean> {
  return new Promise<boolean>(async (resolve) => {
      const canvas = document.createElement('canvas');
      canvas.style.cssText = 'height: 100vh; width: 100%; object-fit: fill; position: absolute; top: 0;';
      document.body.append(canvas);
      const canvasSize = { width: videoElement.videoWidth, height: videoElement.videoHeight };
      faceapi.matchDimensions(canvas, canvasSize);

      let intervalId: any;

      intervalId = setInterval(async () => {
      const detections = await faceapi.detectAllFaces(videoElement, new faceapi.TinyFaceDetectorOptions())
        .withFaceLandmarks()
        .withFaceExpressions()
        .withAgeAndGender()
        .withFaceDescriptors();

      const resizedDetections = faceapi.resizeResults(detections, canvasSize);
      // Limpe o canvas
      const context = canvas.getContext('2d');
      if (context) {
          context.clearRect(0, 0, canvas.width, canvas.height);
      }
      // Desenhe as detecções faciais, landmarks e expressões
      faceapi.draw.drawDetections(canvas, resizedDetections );
      faceapi.draw.drawFaceLandmarks(canvas, resizedDetections );
      const results = resizedDetections.map(d => faceMatcher.findBestMatch(d.descriptor));
      if (results.length > 0 && results[0].label !== 'unknown') {
        clearInterval(intervalId);
        const stream = videoElement.srcObject as MediaStream;
        stream.getTracks().forEach(track => track.stop());
        canvas.remove();
        videoElement.remove();
        resolve(true); // Acesso permitido
      }
      const age: number | undefined = resizedDetections[0].age;
      const interpolatedAge : number = interpolateAgePredictions(age);
      const bottomRight = {
          x: resizedDetections[0].detection.box.bottomRight.x - 50,
          y: resizedDetections[0].detection.box.bottomRight.y
      };
      new faceapi.draw.DrawTextField(
          [`${faceapi.utils.round(interpolatedAge, 0)} years`],
          bottomRight
      ).draw(canvas);
    }, 1000);
  });
}
function interpolateAgePredictions(age: number | undefined): number {
    const maxPredictedAges = 30; // Defina o tamanho máximo desejado

    if (typeof age === 'number') {
        const predictedAges: number[] = [age];

        // Certifique-se de que o array tenha no máximo o tamanho especificado
        if (predictedAges.length > maxPredictedAges) {
            predictedAges.pop(); // Remova o elemento mais antigo
        }

        const sumAges = predictedAges.reduce((total, a) => total + a, 0);
        return sumAges / predictedAges.length;
    }

    return 0; // Ou qualquer outro valor padrão se a idade não for um número
}

async function canActivatePanel(route: ActivatedRouteSnapshot, state: RouterStateSnapshot, router: Router): Promise<boolean> {
  try {
    await loadModels();
    const videoElement = await initializeWebcam();

    const base64Images = [
      { base64: 'data:image/jpeg;base64,', label: 'Bruna' },
      { base64: 'data:image/png;base64,', label: 'Marco' }
      // Adicione mais imagens conforme necessário
    ];

    const faceMatcher = await processBase64Images(base64Images);

    return await waitForDetection(videoElement, faceMatcher);
  } catch (error) {
    console.error('Erro na verificação facial do PANEL', error);
    router.navigate(['/login']);
    return false; // Acesso não permitido
  }
}
